        <tr>
            <td>
                {name}
            </td>
            <td>
                {cuisine}
            </td>
            <td>
                {photo}
            </td>
            <td>
                {ingredients}
            </td>
            <td>
                {preparation}
            </td>
            <td>
                <button name="delete" onClick={deleteRecipe} >Delete</button>
            </td>
        </tr>
    ); 

}

export default RecipeView;
